(item, queryText, itemText) => {
  const itemTextNoAccent = itemText
    .toLocaleLowerCase()
    .normalize("NFD")
    .replace(/[\u0300-\u036f]/g, "");
  const queryTextNoAccent = queryText
    .toLocaleLowerCase()
    .normalize("NFD")
    .replace(/[\u0300-\u036f]/g, "");
  return itemTextNoAccent.indexOf(queryTextNoAccent) > -1;
}

